import React from "react";
import { Link } from "react-router-dom";
import { ChevronRight } from "lucide-react";

function App() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-purple-400 via-pink-500 to-red-500">
      <h1 className="text-5xl font-extrabold text-white mb-8">
        React + Tailwind is Ready ðŸš€
      </h1>

      {/* Clickable icon to navigate to SearchBar page */}
      <Link to="/about">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>

      <Link to="/EmiCalculator">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>
      <Link to="/Emi">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>
      <Link to="/Customer">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>
      <Link to="/CustomerDetails">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>
      <Link to="/CoBorrowEntry">
        <ChevronRight className="w-12 h-12 text-white hover:text-yellow-300 cursor-pointer" />
      </Link>
    </div>
  );
}

export default App;
